description:
+Nhà đẹp chủ tự xây để ở lên rất tâm huyết,thoáng sáng trước sau ,công năng tối ưu.
-Thiết kế;
-Tầng 1;phòng khách bếp wc,
-Tầng 2,3,4,mỗi tầng 1 phòng ngủ rộng,wc khép kín,
-Tầng 5;phòng thờ+ sân phơi;
+Vị trí đẹp hiếm còn sót lại -5m ra đường ô tô tránh .
-Gần hồ-gần K Đ T Khai Sơn-Trường Quốc Tế Việt-Pháp-5 Phút xe máy là sang phố cổ Hồ Gươm.
-Ngõ thông tứ tung ,khu vực tiện ích ,dân trí cao,an ninh tốt;
-Giá chỉ có 3,85 tỷ có thương lượng.
+PHÁP LÝ RÕ RÀNG-SỔ ĐỎ HOA HẬU-SẴN SÀNG GIAO DỊCH .
+LH MR; TUẤN ANH THỔ CƯ LONG BIÊN  -  GỌI HOẶC IBOX 24/24H .
-Để được xem nhà miễn phí;
